    {
        "add_date": "2020-06-17 17:28:26.665369",
        "hotel_id": "92",
        "id": "7",
        "state": "0",
        "text": "They wouldn’t heat our food. They wouldn’t provide cutleries in the room. Internet very poor.. They have lost the human aspect of the tourism and hospitality industry. It’s all about money for them . I had to beg for them to microwave my food and they demanded I pay a huge amount of money.",
        "website_id": "1"
    },
    {
        "add_date": "2020-06-17 17:28:26.846957",
        "hotel_id": "92",
        "id": "8",
        "state": "0",
        "text": "The facilities were old and everything in the room looked as if it was once of good quality but was very worn out. The hair drier was not working, the beddings didn't cover the whole bed, the towels were extremely old and the floor was covered in stains. The staff was also doing the minimum and didn't provide the type of service we would expect from a hotel in this category. Most importantly the wifi was a complete disaster: on some days it didn't work at all and even when it was working, it was so bad that it was impossible to have skype calls. For a hotel which receives a lot of guests on business trips as I was, this is unacceptable. Overall I think that is is overprice for what it offers and will definitely not come back.",
        "website_id": "1"
    },
