    {
        "add_date": "2020-06-17 17:29:20.908366",
        "hotel_id": "92",
        "id": "31",
        "state": "0",
        "text": "Akwa Palace, you’ve said Palace... definitively not. It’s just a very uncomfortable, noisy, smelly, expensive hotel. I got a room in the historical old Akwa Palace with view on the street. The room and furniture are surely 50 years old, the window is not fully closing (imagine at night, trucks and taxis honking all the time), dirty curtains and noisy but working A/C. Refurbishment are ongoing at some floors, which brings additional noises. Smelly carpet in the corridors, noisy (uneducated guests) in the corridor at night. Breakfast is ok, clearly the staff do its best. 2/4 only elevators are working and to be used by staff and guests, leads to long waiting time. The WiFi is working well and the pool seems nice. Conclusion: avoid this place, there’s much better for less money in Douala.",
        "website_id": "1"
    },
