    {
        "add_date": "2020-06-17 17:58:48.826030",
        "hotel_id": "92",
        "id": "518",
        "state": "0",
        "text": "Hotel is very old and has the scars to prove it. It will needs a makeover to bring it back to normalcy. Proximity and ease of transportation to and fro and around town is nice considering the mad traffic in Bonaberi.",
        "website_id": "1"
    },
